import PressCard from "../components/PressCard";

export default function Press() {
  const articles = [
    { title: "Circling Circling", link: "#" },
    // add more
  ];

  return (
    <section className="press">
      <h2>Press</h2>
      <ul>
        {articles.map((a, i) => (
          <PressCard key={i} article={a} />
        ))}
      </ul>
    </section>
  );
}
